//https://leetcode.com/problems/longest-common-subsequence
class Solution {
public:
    int longestCommonSubsequence(string text1, string text2) {
        if(text1.size() == 0 || text2.size() == 0)
            return 0;
        if(text1 == text2)
            return (int)text1.size();
        int max_count = 0;
        queue<tuple<int, int, int>> q;
        q.push({0,0,0});
        vector<vector<bool>> visit(text1.size(), vector<bool>(text2.size(), false));
        while(!q.empty()){
            auto [p1, p2, count] = q.front();
            q.pop();
            if(p1 >= text1.size() || p2 >= text2.size())
                continue;
            if(visit[p1][p2])
                continue;
            visit[p1][p2] = true;
            if(text1[p1] == text2[p2]){
                q.push({p1+1, p2+1, count+1});
                max_count = max(max_count, count+1);
            }else{
                q.push({p1, p2+1, count});
                q.push({p1+1, p2, count});
                max_count = max(max_count, count);
            }
        }
        return max_count;
    }
};

